import React from 'react';
import './App.css';
import firebase from './firebase';

function App() {
  React.useEffect(() => {
    const msg = firebase.messaging();
    msg.requestPermission().then(() => {
      return msg.getToken();
    }).then((data) => {
      console.error("token", data)
    })
  })
  return (
    <div>

    </div>
  );
}

export default App;
